import "./style.css";
const ImageList = ({data})=>{
    console.log(data)
    return(
        <div className="image-container">
           {data.map((image)=>{
            return
            <img key={image.id} src={`https://farm${image.farm}.staticflickr.com/${image.server}/${image.id}_${image.secret}_m.jpg`} alt={image.title}/>
           })}


        </div>
    )
}

export default ImageList;
